import useUser from "./components/hooks/user.hook";

function App() {

    const {user, updateUser} = useUser();

    return (
        <body className='w-screen h-screen flex items-center justify-center flex-col space-y-12'>
            <button onClick={updateUser}>UpdateTest</button>
            <div className='w-36 text-xl '>
                {user.firstname}
                {user.lastname}
            </div>
        </body>
    );
}

export default App;
